import React,{useEffect, useState} from 'react';
import Axios from 'axios';
import './App.css';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import { Header, Navbar } from './components/common';



function App() {
  return (
    <div className="App">
     <Header />
     <br />
        <br />
        <br />
        <br />
        <Router>
          <Switch>
            <Route path="/contact">
              Contact Me
            </Route>
            <Route path="/about">
              njkln
            </Route>
            <Route path="/">
              Home
            </Route>
          </Switch>
        </Router>

    </div>
  );
}

export default App;
